import React from "react";
import FadeSlider from "./fadeslider";

const page = () => {
  return (
    <div className=" flex">
      <div className=" bg-black w-1/2 h-[600vh] text-white">
        <div className=" sticky top-[50%] left-0">
          <h1 className=" text-4xl mx-10">Create at speed of light</h1>
        </div>
      </div>
      <FadeSlider />
    </div>
  );
};

export default page;
